import React from "react"
import "../css/Footer.css";
function Footer() {
  return (
    <div className="footer"> <footer class="page-footer font-small">

      <div class="footer-copyright text-center py-3">Kreirano od strane
        <a href="http://www.fon.bg.ac.rs/" target="_blank" rel="noopener noreferrer" className="author"> student @ FON </a>
      </div>

    </footer>
    </div>
  );
}

export default Footer;
